import dinoLogo from './images/dinoLogo.png';

const handleLogoutRestaurant = () => {
    localStorage.clear();
    window.location.href = "/restaurantLogin";
  };
  const handleLogoutUser = () => {
    localStorage.clear();
    window.location.href = "/";
  };

const navbar = () => {
    return (
        <div className="navbar">
            <a href="/" className='home-link'><img className="dinologo" src={dinoLogo} /></a>
            <h1>DinoSpace</h1>
            <div className="links">
                {localStorage.getItem("usertoken") ? <a href="/restaurantSignUp">Sign Up</a> : <a href="/restaurantSignIn">Sign In</a>}
                <a href="/Profile">Profile</a>
                <a href="/"onClick={handleLogoutUser}>logout</a>
            </div>
        </div>
    );
}

export default navbar;
